import Main from "../components/Main/Main"
import "../App.css"

const Home = () => {
  // gsap.ScrollTrigger,
  console.log(gsap)
  // gsap.registerPlugin(gsap.ScrollSmoother)
  // gsap.ScrollSmoother.create({
